sub fibonacci {
    my $n = shift;
    return $n if $n <= 1;
    return fibonacci($n - 1) + fibonacci($n - 2);
}

print "Masukkan panjang deret Fibonacci: ";
my $panjang = <STDIN>;
chomp($panjang);

print "Deret Fibonacci: ";
for (my $i = 0; $i < $panjang; $i++) {
    print fibonacci($i), " ";
}
print "\n";

print "Masukkan tinggi segitiga: ";
my $tinggi = <STDIN>;
chomp($tinggi);

for my $i (1..$tinggi) {
    for my $j (1..$i) {
        print "* ";
    }
    print "\n";
}

sub sum_of_even {
    my ($start, $end) = @_;
    my $sum = 0;
    for my $num ($start..$end) {
        $sum += $num if $num % 2 == 0;
    }
    return $sum;
}

print "Masukkan rentang bilangan (misalnya 1 10): ";
my $input = <STDIN>;
chomp($input);

my ($start, $end) = split(' ', $input);

my $result = sum_of_even($start, $end);
print "Jumlah bilangan genap dari $start hingga $end adalah $result\n";

sub factorial {
    my $n = shift;
    return 1 if $n == 0;
    return $n * factorial($n - 1);
}

print "Masukkan bilangan: ";
my $input = <STDIN>;
chomp($input);

my $result = factorial($input);
print "Faktorial dari $input adalah $result\n";

